import {useState} from 'react';




const HomePage = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch("https://corona.lmao.ninja/all")
            .then(data => data.json())
            .then(cor => {
                setData(cor)
            })
            .catch(error => {
                console.log(error)
            })
    },[])

    return (
        <>
        {
            data.map((item) => {
                console.log(item)
            })
        }
        </>
    );
}

export default HomePage
